def get_indexer(
    self,
    target: AnyArrayLike,
    method: Optional[str] = None,
    limit: Optional[int] = None,
    tolerance: Optional[Any] = None,
) -> np.ndarray:
    if method is not None or limit is not None or tolerance is not None:
        raise NotImplementedError(
            "If any method argument other than the default of None is specified as these are not yet implemented."
        )

    if self.is_overlapping:
        msg = "cannot handle overlapping indices; use IntervalIndex.get_indexer_non_unique"
        raise InvalidIndexError(msg)

    target_as_index = ensure_index(target)

    if isinstance(target_as_index, (IntervalIndex, pd.CategoricalIndex)):
        if self.equals(target_as_index):
            return np.arange(len(self), dtype="intp")
        else:
            indexer = np.repeat(np.intp(-1), len(target_as_index))

        return indexer
    elif isinstance(target_as_index, Index):
        indexer = target_as_index.get_indexer(self)
        return indexer
